INSERT INTO `rtc_epl` VALUES (1,1,'ip监控','insert into IPMonitor\r\nselect fundid, count(distinct stationaddr) ipcnt\r\nfrom Entrust.win:time(10 sec)\r\ngroup by fundid\r\nhaving count(distinct stationaddr)>${cnt}',1,'用户在10秒以内使用5个以上的IP进行交易',1),(2,2,'大额频繁交易','insert into AssetsMonitor \r\nselect t.fundid as fundid,count(1) as entrustCnt\r\nfrom Entrust.win:time(5 sec)  as t, method:FundAssetsLookUp.getFundAssetsByFundId(t.fundid) as r\r\nwhere cast(t.orderqty,long) >= ${orderqty} and cast(t.orderqty,double)*cast(t.orderprice,double) >= ${totalAmount} and r.assets>=${totalAssets} and r.smallCapitalCnt>${smallCapitalCnt} and r.bigCapitalCnt>${bigCapitalCnt} \r\ngroup by t.fundid\r\nhaving count(1)>=${entrustCnt}',1,'对于持有总市值大于1000万，即持有小市值股票又持有大市值股票的用户若单次交易的总金额大于1000万或购买股数超过1000万视为大额频繁交易。',1);
